import React from "react";
import { Link, useNavigate } from "react-router-dom";

const AdminNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("adminToken");
    navigate("/admin/login");
  };

  return (
    <nav className="bg-blue-600 text-white shadow-md">
      <div className="max-w-7xl mx-auto px-4 py-3 flex items-center justify-between">
        <div className="text-xl font-bold">
          <Link to="/admin/dashboard">Admin Panel</Link>
        </div>
        <div className="space-x-4 hidden md:flex">
          <Link to="/admin/dashboard" className="hover:underline">Dashboard</Link>
          <Link to="/admin/add-ev-bunk" className="hover:underline">Add Bunk</Link>
          <Link to="/admin/view-bunks" className="hover:underline">View Bunks</Link>
          <Link to="/admin/booking/list" className="hover:underline">View Bookings</Link>
          <Link to="/admin/view-bunk-locations" className="hover:underline">View Locations</Link>
          <button
            onClick={handleLogout}
            className="hover:underline text-red-100"
          >
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
};

export default AdminNavbar;
